\u0412\u043e\u043f\u0440\u043e\u0441 11.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Бозон сообщает массу всему, что есть во Вселенной, он свидетельствует о
наличии невидимого поля, проходя через которое частицы приобретают вес;
это похоже на то, как Питер Хиггс пробивается сквозь толпу людей.

\u0412\u043e\u043f\u0440\u043e\u0441 5.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Вымышленный язык, используемый в произведениях Толкина слугами Саурона;
интересно, что английское название готического шрифта - Blackletter, а
черного наречия - Black Speech.

\u0412\u043e\u043f\u0440\u043e\u0441 2.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Собака не просто охраняет дом, это еще и аллюзия на атрибут опричника;
святого Христофора изображают с головой пса, неудивительно, что он
популярен у далматинцев.

\u0412\u043e\u043f\u0440\u043e\u0441 9.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Из-за наручников рыбак-браконьер не мог показать, рыбу какого размера он
недавно поймал, поэтому он показал, какого размера у рыбы были глаза;
рыбий глаз тоже имеет обзор почти на 180 градусов.
